package com.saltedfish.algorithms;

public class LeetCode6138 {
    class Solution {

        public int longestIdealString(String s, int k) {
            int n = s.length();
            int[][] dp = new int[n+1][26];
            int res = 0;
            for (int i = 1 ; i <= n; ++i){
                int ch = s.charAt(i) - 'a';
                int maxv = 0;
                for (int j = 0; j < 26; ++j){
                    // 遍历dp[i - 1]中以26个字符结尾的子序列长度，找到满足题目条件的最大长度
                    if (Math.abs(ch - j) <= k){
                        maxv = Math.max(dp[i-1][j], maxv);
                    }
                    // 其他结尾的长度直接复制过来
                    dp[i][j] = dp[i-1][j];
                }
                dp[i][ch] = maxv + 1;

                res = Math.max(res, dp[i][ch]);
            }
            return res;
        }
    }

    public static void main(String[] args) {
        LeetCode6138.Solution solution = new LeetCode6138().new Solution();
        System.out.println(solution.longestIdealString("",
                8));
    }
}
